    artist_display: "Camille Pissarro\nFrench, 1830-1903",
    place_of_origin: "France",
    description:
      '<p>Along with Impressionist painters <a href="https://www.artic.edu/artists/35809">Claude Monet</a> and <a href="https://www.artic.edu/artists/36707">Alfred Sisley</a>, Camille Pissarro pursued the theme of snow throughout his career, producing nearly 100 “snow” paintings. In 1879 France experienced an extraordinarily severe winter, which Pissarro explored in this and other works painted at his home in Pontoise, 30 miles west of Paris, along the Seine River. In Rabbit Warren, snow covers the ground, houses, and vegetation in a frothy coat that resulted from the artist’s vigorous brushwork. Throughout, small spots of color in the chimneys, greenish shrubs, and clothing of the man at right punctuate what is otherwise a predominately yellowish white and uninhabited fragment of nature.</p>\n',
    short_description:
      "Along with Impressionist painters Claude Monet and Alfred Sisley, Pissarro pursued the theme of snow throughout his career, producing nearly 100 “snow” paintings. In 1879 France experienced an extraordinarily severe winter, which Pissarro explored in this and other works painted at his home in Pontoise, 30 miles west of Paris. Here snow covers the ground, houses, and vegetation in a frothy coat that resulted from the artist’s vigorous brushwork.",
