    exhibition_history:
      "Paris, Galeries Durand-Ruel, Camille Pissarro, Jan. 23–Feb. 20, 1892, cat. 11, as La Garenne, à Pontoise; effet de neige, Appartenant à Mme P. \n\nArt Institute of Chicago, The Artist Looks at the Landscape, June 22–Aug. 25, 1974, no cat. \n\nLondon, Hayward Gallery, Pissarro: Camille Pissarro 1830–1903, Oct. 30, 1980–Jan. 11, 1981, cat. 51 (ill.); Paris, Galeries Nationales du Grand Palais, Jan. 30–Apr. 27, 1981; Museum of Fine Arts, Boston, May 19–Aug. 9, 1981.\n\nLos Angeles County Museum of Art, A Day in the Country: Impressionism and the French Landscape, June 28–Sept. 16, 1984, cat. 68 (ill.); Art Institute of Chicago, Oct. 23, 1984–Jan. 6, 1985; Paris, Galeries Nationales d’Exposition du Grand Palais, as L’impressionnisme et le paysage français, Feb. 4–Apr. 22, 1985, cat. 34.\n\nTokyo, Seibu Museum of Art, Shikago bijutsukan insho-ha ten [The impressionist tradition: Masterpieces from the Art Institute of Chicago], Oct. 18–Dec. 17, 1985, cat. 27 (ill.); Fukuoka Art Museum, Jan. 5–Feb. 2, 1986; Kyoto Municipal Museum of Art, Mar. 4–Apr. 13, 1986.\n\nLondon, Hayward Gallery, Landscapes of France: Impressionism and its Rivals, May 18–August 28, 1995, cat. 92 (ill.); Museum of Fine Arts, Boston, [as Impressions of France: Monet, Renoir, Pissarro, and their Rivals] October 4, 1995–January 14, 1996.\n\nWashington, D.C., Phillips Collection, Impressionists in Winter: Effets de Neige, Sept. 19, 1998–Jan. 3, 1999, cat. 44 (ill.); San Francisco, Fine Arts Museums of San Francisco at the Center for the Arts at Yerba Buena Gardens, Jan. 30–May 2, 1999; Brooklyn Museum of Art, May 27–Aug. 29, 1999.",
    provenance_text:
      "The artist (d. 1903); given to Julie Pissarro (artist’s wife), Paris, by 1892 [per Galeries Durand-Ruel, Exposition Camille Pissarro, exh. cat. (E. Ménard et Cie, 1892), p. 23, cat. 11]; by descent to her son, Ludovic-Rodolphe (Rodo) Pissarro, Paris, 1904 [this and the seven following per Pissarro and Snollaerts 2005]; sold jointly to Durand-Ruel, Paris, and Bernheim-Jeune, Paris, Aug. 7, 1918; share sold by Durand-Ruel, Paris, to Bernheim-Jeune, Paris, Mar. 12, 1920. Georges Petit Paris, by Mar. 31, 1924; sold to Prat, Mar. 31, 1924. Sam Salz, New York, around 1958. Martin and Sidney Zimet, New York, by Jan. 11, 1963; half share sold to M. Knoedler & Co., New York, Jan. 11, 1963 [per the M. Knoedler & Co., New York, stock book for Feb. 1959–Dec. 1970 (no. 8436, as La Gareane [sic] a Pontoise, Effet de Neige), copy in curatorial object file]; sold to Marshall Field, Chicago, by June 1964 [per Committee on Earlier Painting and Sculpture minutes, June 10, 1964, on file in Museum Registration, Art Institute of Chicago]; given to the Art Institute of Chicago, beginning in June 1964 [in undivided fractional interests, receiving final fractional interest for one hundred percent ownership in 1965].",
