    exhibition_history:
      "Paris, Galeries Durand-Ruel, Exposition d’oeuvres récentes de Claude Monet, May 1891, cat. 1, as Meules. (Fin de l’été.). Appartient à M. Durand-Ruel. \n\nBoston, Copley Society, Loan Collection of Paintings by Claude Monet and Eleven Sculptures by Auguste Rodin, Mar. 1905, cat. 9, as Meules. Fin de l’Eté. 1891. Lent by Mrs. Potter Palmer. \n\nPossibly Art Institute of Chicago, Paintings from the Collection of Mrs. Potter Palmer, May 10–Aug., 1910, cat. 34, as Haystacks. \n\nArt Institute of Chicago, Paintings by Monet, Mar. 15–May 11, 1975, cat. 88 (ill.). \n\nLos Angeles County Museum of Art, A Day in the Country: Impressionism and the French Landscape, June 28–Sept. 16, 1984, cat. 108 (ill.); Art Institute of Chicago, Oct. 23, 1984–Jan. 6, 1985; Paris, Galeries Nationales d’Exposition, Grand Palais, as L’impressionnisme et le paysage français, Feb. 4–Apr. 22, 1985. \n\nArt Institute of Chicago, The Art of the Edge: European Frames, 1300–1900, Oct. 17–Dec. 14, 1986, not in cat. \n\nBoston, Museum of Fine Arts, Monet in the ’90s: The Series Paintings, February 7–April 29, 1990, cat. 17 (ill.); Art Institute of Chicago, May 19–August 12, 1990; London, Royal Academy of Arts, September 7–December 9, 1990 [Boston and Chicago only].\n\nArt Institute of Chicago, Chicago’s Dream, a World’s Treasure: The Art Institute of Chicago, 1893–1993, Nov. 1, 1993–Jan. 9, 1994, not in cat.\n\nArt Institute of Chicago, Claude Monet, 1840–1926, July 22–Nov. 26, 1995, cat. 97 (ill.). \n\nFlorence, Sala Bianca di Palazzo Pitti, Claude Monet: La poesia della luce; Sette capolavori dell’Art Institute di Chicago a Palazzo Pitti, June 2–Aug. 29, 1999, no cat. no. (ill.).\n\nHamburg, Hamburger Kunsthalle, Monets Vermächtnis: Serie—Ordnung und Obsession, Sept. 28, 2001–Jan. 6, 2002, no cat. no. (ill.).\n\nFort Worth, Tex., Kimbell Museum of Art, The Impressionists: Master Paintings from the Art Institute of Chicago, June 29–Nov. 2, 2008, cat. 75 (ill.).\n\nArt Institute of Chicago, Monet and Chicago, September 5, 2020-June 14, 2021, cat. 52.",
    provenance_text:
      "The artist (d. 1926); sold to Durand-Ruel, Paris, May 9, 1891, for 3,000 francs [this and the following per Durand-Ruel, Paris, stock book for 1891–1901 (no. 938, as Meules, fin de l’été), as confirmed by Paul-Louis Durand-Ruel and Flavie Durand-Ruel, Durand-Ruel Archives, to the Art Institute of Chicago, Feb. 5, 2013, curatorial object file]; sold to Charles Fairchild, Boston, June 26, 1891, for 5,000 francs; returned to Durand-Ruel, Paris, Aug. 4, 1891, in exchange for Monet’s Sur la falaise à Pourville, 1882 [per Durand-Ruel, Paris, Brouillard for 1888–91 (as Meules, fin de l’été): “Sold on 26 June 1891 to Ch. Fairchilds [sic], 191 Commonwealth Av. Boston, for 5 000 F. Exchanged for another Monet (Wildenstein 755) on 4 August 1891,” as confirmed by Paul-Louis Durand-Ruel and Flavie Durand-Ruel, Durand-Ruel Archives, to the Art Institute of Chicago, Feb. 5, 2013, curatorial object file. Fairchild exchanged the painting now in the Art Institute’s collection for Sur la falaise à Pourville (1882) now in the Nationalmuseum, Stockholm, see Wildenstein 1996]; sold to Potter Palmer (d. 1902), Chicago, Aug. 4, 1891, for 6,000 francs [per Durand-Ruel, Paris, stock book for 1888–1901 and Brouillard 1888–91 (no. 938, as Meules, fin de l’été), as confirmed by Paul-Louis Durand-Ruel and Flavie Durand-Ruel, Durand-Ruel Archives, to the Art Institute of Chicago, Feb. 5, 2013, curatorial object file]; by descent to the Palmer Family; by descent to Arthur M. Wood and Pauline Palmer Wood (d. 1984), Lake Forest, Illinois; given to the Art Institute of Chicago, beginning in 1985 [The painting was given to the Art Institute of Chicago in undivided fractional interests beginning in 1985. The Art Institute received the final fractional interest for one hundred percent ownership in 2007].",
