      "<p>Since historical records have been kept, Pueblo potters have been almost exclusively women. There is every reason to expect that this has always been true. Nampeyo became the most famous potter who revived Hopi ceramic art around the turn of the 20th century. Drawing upon archaeological Sikyatki shapes, colors, and motifs, Nampeyo created her own inventive designs, continuing the Pueblo tradition of resynthesis and renewal. Today her descendants Dextra Quotskuyva Nampeyo and Fannie Nampeyo carry on the tradition, along with many other excellent potters throughout the Pueblo world.</p>\n",
