    place_of_origin: null,
    description:
      '<p>Architectural drawings, specifications, and rental information for the 900 North Michigan Avenue Building, Chicago, Illinois, designed by architect Jarvis Hunt. High-quality shops were located on the ground floor, with thirty-three rental apartments on the second and third floors. The remaining six floors were divided into thirty-six units for the owners of the cooperative apartment building. These apartments ranged in size from four to twelve rooms and some were duplexed. The U-shaped courtyard building was clad in stone on the lower levels and in brick on the upper levels. An effort to place the building on the Illinois Register of Historic Places failed in the early 1980s and demolition of the structure began in June, 1984. A new multi-use building designed by Kohn Pedersen Fox Associates and Perkins &amp; Will was constructed on the site.</p>\n<p><a href="http://digital-libraries.saic.edu/cdm/search/collection/findingaids/searchterm/900%20North%20Michigan%20Avenue%20Building%20Collection/field/title/mode/all/conn/and/cosuppress/1">View finding aid.</a><br><a href="http://digital-libraries.artic.edu/cdm/search/collection/mqc/searchterm/900%20North%20Michigan%20Avenue%20Building%20Collection/field/subcol/mode/all/conn/and/cosuppress/1">View entirely digitized collection.</a></p>\n<p>Collection access:<br>Collections may be accessed in the Franke Reading Room of the Research Center at The Art Institute of Chicago, by appointment only. For further information, consult <a href="https://www.artic.edu/archival-collections/contact-usage-and-faq">the FAQ</a>.</p>\n<p><a href="https://www.artic.edu/archival-collections/finding-aids">Finding aids by subject</a><br><a href="http://digital-libraries.saic.edu/cdm/landingpage/collection/findingaids">Browse all finding aids</a><br><a href="http://digital-libraries.saic.edu/cdm/landingpage/collection/mqc">Browse images and media</a><br><a href="https://www.artic.edu/archival-collections/oral-histories">Oral histories</a></p>\n<p>Contact the Ryerson and Burnham Art and Architecture Archives:<br>archives@artic.edu</p>\n',
