    place_of_origin: null,
    description:
      "<p>Since the late 1960s, Mary Lovelace O’Neal has expanded the field of abstract painting through her experiments with color, figuration, and materiality often speaking to the sociopolitical dimensions of race. <em>Running with Black Panthers and White Doves</em> was inspired by O’Neal’s travels in Morocco, particularly, in the artist’s own words, by “the biblical presence of North Africa, and a palace in Asilah, Morocco—the mosaics and moonlight that smeared the ocean.” The work derives its title from the dialogue of the black king in Gian Carlo Menotti’s Amahl and the Night Visitors: “I live in a black marble palace with black panthers and white doves.”</p>\n<p>While the title conjures the civil rights movement of the 1960s and 1970s, in which O’Neal was an active participant, the painting is anchored in the artist’s personal experience, particularly her relationship to her father. O’Neal performed in the opera Amahl and the Night Visitors, which her father, a music director at the University of Arkansas and Tougaloo College, staged each year. Merging the personal, the lyrical, and the political, <em>Running with Black Panthers and White Doves</em> transfigures O’Neal’s political views and aspirations into allegorical form, as the North African courtyard becomes the interior where, as the opera suggests, a black panther resides in perpetual motion.</p>\n",
