    date_qualifier_title: "",
    date_qualifier_id: null,
    artist_display: "Pierre-Auguste Renoir\nFrench, 1841-1919",
    place_of_origin: "France",
    description:
      "<p>The two little circus girls in this painting are Francisca and Angelina Wartenberg, who performed as acrobats in the famed Cirque Fernando in Paris. Although they were depicted in the center of a circus ring, the sisters actually posed in costume in Pierre-Auguste Renoir’s studio, enabling him to paint them in daylight. Here he portrayed them just as they have finished their act and are taking their bows. One sister turns to the crowd, acknowledging its approval, while the other faces the viewer with an armful of oranges, a rare treat that the audience has tossed in tribute. Although <em>Acrobats at the Cirque Fernando</em> reﬂects the artist’s enchantment with the innocence of childhood—he has enveloped the girls in a virtual halo of pinks, oranges, yellows, and whites—the partially visible, darkly clothed (mainly male) spectators allude to the less wholesome, nocturnal demimonde of the nineteenth-century circus in which these two young performers grew up. The famed Chicago collector Mrs. Potter Palmer purchased <em>Acrobats at the Cirque Fernando</em> in 1892 and was so enamored of the picture that she kept it with her at all times, even on her travels abroad.</p>\n",
    short_description:
      "The two girls in this painting by Pierre-Auguste Renoir are Francisca and Angelina Wartenberg, acrobats who performed in the famed Cirque Fernando in Paris. They are depicted clutching oranges tossed to them from the crowd as gifts. Although they are painted standing in the center of a circus ring, Renoir actually painted them in his studio, where he could take full advantage of natural sunlight.",
