    provenance_text:
      "The artist (d. 1919); deposited with Durand-Ruel, Paris, Apr. 6, 1881 [per Durand-Ruel, Paris, stock book for 1879–84 (no. 3155, as Les Petites acrobates), as confirmed by Paul-Louis Durand-Ruel and Flavie Durand-Ruel, Durand-Ruel Archives, Oct. 5, 2010, curatorial object file]; sold to Durand-Ruel, Paris, May 12, 1882, for 2,000 francs. [This transaction is recorded in the Durand-Ruel, Paris, stock book for 1880–82 (no. 2362, as Les Saltimbanques), as confirmed by Paul-Louis Durand-Ruel and Flavie Durand-Ruel, Durand-Ruel Archives, Oct. 5, 2010, curatorial object file]; sold to Potter Palmer (d. 1902), Chicago, May 11, 1892, for 8,000 francs [per Durand-Ruel, Paris, stock book for 1891 (no. 319, as Dans le cirque), as confirmed by Paul-Louis Durand-Ruel and Flavie Durand-Ruel, Durand-Ruel Archives, Oct. 5, 2010, curatorial object file]; by descent to the Potter family; given to the Art Institute of Chicago, 1922.",
