    place_of_origin: "France",
    description:
      "<p>Sculptor Constantin Brancusi believed the material with which he worked had its own life, a uniqueness and essence that he had to seek out in order to reveal the form contained within. In <em>Leda</em>, sculptural metamorphosis became the very subject of the work. According to classical mythology, the god Zeus changed into a swan in order to seduce the beautiful Leda. Brancusi explained to visitors to his studio that he chose to transform the transformation—changing Leda, rather than Zeus, into a swan. He explained, &quot;I never could imagine a male being turned into a swan, impossible, but a woman, yes, quite easily.&quot; Brancusi envisioned the form &quot;ceaselessly creating a new life, a new rhythm,&quot; which he enhanced by its circular concrete base, a type that he designed by 1916 and used in various sizes for many different sculptures.</p>\n",
    short_description:
      'Constantin Brancusi rendered his human and animal forms as highly abstracted, almost geometric shapes. Here, he refers to a Greek myth in which the god Zeus transformed into a swan to seduce the beautiful Leda, but Brancusi confessed he "never could imagine a male being turned into a swan" and reversed the transformation in his sculpture. His swan, Leda, glows in streamlined, white stone.',
