    place_of_origin: "Chicago",
    description:
      '<p>A palpable energy and sense of movement enliven <em>Nightlife</em>, Archibald Motley’s portrayal of a crowded cabaret in the South Side neighborhood of Bronzeville in Chicago. With stylized figures, an array of diagonal lines, and heightened colors keyed to shades of magenta and violet, the artist captured the exuberance of city dwellers out on the town. Motley created a network of gestures and glances among the people, drawing attention to the various social interactions that animate the scene.</p>\n<p>The composition is an exploration of artificial lighting. Motley was inspired, in part, to paint <em>Nightlife</em> after having seen Edward Hopper’s <a href="https://www.artic.edu/artworks/111628/nighthawks"><em>Nighthawks</em></a> (1942.51), which had entered the Art Institute’s collection the prior year.</p>\n',
    short_description:
      "A native Chicagoan and graduate of the School of the Art Institute, Motley used his art to represent the vibrancy of African American culture, frequently portraying young, sophisticated city dwellers out on the town. One of Motley’s most celebrated paintings, <em>Nightlife</em> depicts a crowded cabaret in the South Side Bronzeville neighborhood. The dynamic composition, intense lighting, and heightened colors vividly express the scene's liveliness.",
