    place_of_origin: "Chicago",
    description:
      "<p>Chicagoan Archibald Motley attended the School of the Art Institute at a time when many prominent art academies denied entrance to African American students. His affiliation with the school was thus of great significance to him. Around 1920, as a recent graduate, he painted a self-portrait meant to introduce him as a poised young artist, elegantly presenting himself in a dark suit jacket, crisp white shirt, and a dark tie accented by a diamond horseshoe pin. Furthermore, Motley painted this work following race riots in July 1919, which had heightened tensions in Chicago. The violence convinced him that he should use his art to influence perceptions of African Americans in a positive manner. This sophisticated self-portrait is thus an extraordinary declaration of his goals and ambitions.</p>\n",
