    artist_display: "Nicole Eisenman \nAmerican, born France 1965",
    place_of_origin: "United States",
    description:
      "<p>The artists depicted in <em>The Drawing Class<em>, who study a crudely rendered nude model,embody human and inhuman characteristics. Their blank stares and closed mouths suggest an overall feeling of calm and contemplation. Eisenman disturbed this, however, with violent scratch marks that wipe out a figure’s face and distortions of the female form. She objectified the female figure through the alien appearance of the model and the exaggerated anatomy depicted in a painting on the wall. Within a complex back-and-forth of gazes, the viewer appears to stand in for an artist, locking eyes with the model. A mirror leaning against the studio’s back wall contains a blurred reflection that allows yet another entry point for the viewer. According to artist Amy Sillman, “The gaze is critical [in Eisenman’s work]. We look at someone as they look at someone or something, creating instant shame at the self-consciousness involved in being seen, being judged, being aware of the moment.”</p>\n<p>Nicole Eisenman has made narrative drawings, paintings, and installations with an irreverent sense of humor since the early 1990s. She was originally dubbed a “bad-girl” painter for her emotionally charged content, which often included feminist inspired takes on female subjects. She combines historical elements of painting—from Renaissance to modern art—with appeals to popular culture, including pornography, horror films, and punk music. Her complex narratives always involve the human figure, whether alone or in a crowd, to evoke feelings of anxiety, fear, and isolation.</p>\n",
