    exhibition_history:
      "New York, An American Place, <em>Exhibition of Georgia O’Keeffe</em>, Jan. 27–Mar. 11, 1941, checklist only, no. 7. \n\nCharleston, SC, Carolina Art Association, Gibbes Art Gallery, <em>Georgia O’Keeffe</em>, Feb. 8–March 6, 1955, checklist only, no. 14, as <em>Red Hills with Flowers—Summer</em>.\n\nManchester, NH, Currier Gallery of Art, <em>Four MacDowell Medalists: Alexander Calder, Edward Hopper, Louise Nevelson, Georgia O’Keeffe</em>, June 30–July 29, 1973, checklist only; Keene, NH, Louise E. Thorne Memorial Art Gallery, Keene State College, Aug. 19–Sept. 15, 1973. \n\nBirmingham, AL, Birmingham Museum of Art, <em>The Expressionist Landscape, North American Modernist Painting, 1920–1947</em>, Sept. 11–Nov. 4, 1987, cat. 87; New York, IBM Gallery of Science and Art, Nov. 24, 1987–Jan. 30, 1988; Syracuse, NY, Everson Museum of Art, Feb. 14–Mar. 27, 1988; Akron, OH, Akron Art Museum, Apr. 9–June 5, 1988; Vancouver, Ontario, Vancouver Art Gallery, June 30–Aug. 21, 1988.",
