    place_of_origin: "Abiquiu",
    description:
      "<p>Georgia O’Keeffe often painted the dramatic geological formation known as the White Place, or Plaza Blanca, which she could see from a window in her home near Abiquiu, New Mexico. Composed of a white stone that stands out starkly against the colors of the surrounding terrain, the White Place was whittled and smoothed by water and wind over centuries into a striking formation resembling columns, cliffs, and towers. Here, O’Keeffe selected a view that emphasizes a deep cleft between two spires. The V-shaped composition accentuates the interplay between the brilliant blue sky, the eerie white color, and the horizontal striations of the rock.</p>\n",
