    description:
      '<p>“I went out one morning to look at [the Shelton Hotel] and there was the optical illusion of a bite out of one side of the tower made by the sun, with sunspots against the building and against the sky,” said Georgia O’Keeffe, recalling the precise moment that inspired her to paint <em>The Shelton with Sunspots.</em> Although her depictions of flowers and the southwestern landscape are powerful and evocative, O’Keeffe painted a group of cityscapes in the 1920s that are no less intriguing. She married the photographer and dealer Alfred Stieglitz in 1924, and the following year they moved into the Shelton, a recently completed skyscraper. O’Keeffe was fascinated by the soaring height of the building and emphasized its majesty in this painting by rendering it from the street below. In the glaring light of the emerging sun, the building becomes an abstracted series of rectangles arranged in the center of the composition. Yet the hard edges of the Shelton are softened by the numerous circular sunspots and wavy, flowing lines of smoke and steam, suggesting that despite her urban subject matter, O’Keeffe nevertheless sought to unify man-made and organic forms, just as she would in her southwestern paintings such as <a href="https://www.artic.edu/artworks/46327"><em>Black Cross, New Mexico </em></a>.</p>\n',
    short_description:
      "In 1925, Georgia O'Keeffe moved to the 30th floor of the New York's Shelton Hotel, then the tallest hotel in the world. Fascinated by the building's height, she painted a series of celebratory cityscapes. She described this scene as an \"optical illusion of a bite out of one side of the tower made by the sun, with sunspots against the building and against the sky.\"",
