    place_of_origin: "United States",
    description:
      "<p>Georgia O’Keeffe was fascinated by the animal bones, weathered and worn, that she found in the desert in New Mexico. In <em>Red and Pink Rocks and Teeth</em> she presented a jawbone alongside two stacked rocks that appear both monumental and indeterminate. The smooth, rounded forms of the red and pink rocks appear in enigmatic relation to one another, as the red pebble appears to recede from the picture plane even though it must be perched on top of the pink stone. Their abstracted forms and warm colors contrast sharply with the bleached, angular teeth and hard, cracked appearance of the jawbone and together construct a modern trompe l’oeil that questions the nature of representation and perception.</p>\n",
