      "<p>In the 1920s Georgia O’Keeffe began creating the paintings of enlarged flowers for which she is most famous, including a series of works devoted to the white rose; this painting is her most abstracted depiction of the subject. O’Keeffe simplified the energy of the blooming rose to its essence, so that it resembles a brilliant light radiating out of flat Cubist planes. She exhibited this painting as <em>White Rose—Abstraction</em> at Alfred Stieglitz’s Intimate Gallery in 1928 and retitled it <em>Ballet Skirt or Electric Light (from the White Rose Motif)</em> when she lent it to the Art Institute of Chicago’s 1943 retrospective of her work.</p>\n",
