    artist_display: "Georgia O'Keeffe (American, 1887–1986)",
    place_of_origin: "United States",
    description:
      "<p>Georgia O’Keeffe collected this cow’s skull in New Mexico during the summer of 1930, when a drought had devastated the Southwest, and many animal skeletons could be found in the desert. She was captivated by the stark elegance of the bones and shipped some back to New York so she could paint them the following year. She noted, “To me they are as beautiful as anything I know. . . . The bones seem to cut sharply to the center of something that is keenly alive on the desert.” O’Keeffe’s inclusion of the calico fabric roses—which were used to decorate graves in New Mexico—further evokes questions of life, death, and mortality.</p>\n",
