    description:
      "<p>Georgia O’Keeffe traveled to the Gaspé Peninsula, in Quebec, Canada, in the summer of 1932, accompanied by Alfred Stieglitz’s niece, Georgia Engelhard, who was also an artist. The old barns and crosses built by the region’s French settlers fascinated O’Keeffe, as did the lush green terrain, which she featured in <em>Green Mountains, Canada</em>. In this panoramic landscape, she captured the massive appearance of the mountains as they rise sharply from the water’s edge. Although she enjoyed her trip to Canada, and returned again that year, ultimately O’Keeffe preferred the New Mexican landscape, specifically its brilliant sunshine.</p>\n",
