    description:
      "<p><em>Thistles</em> captures the tangled movement of the windblown plants in light and shadow. Executing this work in rural England (or possibly in Nice, France), John Singer Sargent experimented with broken brushwork and a vibrant palette. The landscape composition is remarkably abstract, with the dynamic patterning of the thistles asserting the flatness of the picture plane more than any sense of depth.</p>\n<p>Beginning in 1885, the artist spent more time painting out of doors, exploring the techniques and subjects of Impressionism, inspired by a growing friendship with Claude Monet. Sargent continued painting <em>en plein air</em> throughout his life, a practice that provided needed respite from his busy schedule as an acclaimed portraitist.</p>\n",
