    description:
      "<p>John Singer Sargent traveled to Egypt in 1891 in search of source material for a mural commission for the Boston Public Library. Like many 19th-century Western European artists, he was drawn to the Middle East by the region’s perceived exoticism and its ancient histories. The identity of the woman who posed in Cairo for this full-length figure study is not known. She assumes a complicated posture, placing her weight on her right foot while twisting her upper body to the left. Instead of using the bravura painterly style of swift, visible brushstrokes that characterizes his society portraits, Sargent returned to his academic training, carefully modeling the human form and a range of flesh tones. <em>Life Study</em> was widely exhibited, including at the World’s Columbian Exposition in Chicago in 1893.</p>\n",
