    artist_display: "John Singer Sargent (American, 1856–1925)",
    place_of_origin: "Frascati",
    description:
      "<p>The year 1907 was a turning point for John Singer Sargent, as he daringly stepped away from his successful career as a portraitist in favor of plein air painting. This strong and lively work aptly captures that moment of transition, combining landscape and portraiture in a composition that speaks to friendship and painterly pursuits while also celebrating color, surface, and fleeting effects of light and movement. The couple is Wilfrid and Jane Emmet de Glehn, professional artists and Sargent’s frequent traveling companions. Although <em>The Fountain</em> has the appearance of spontaneity, Sargent was frequently interrupted by rain as he worked. He thus completed it over several days, requiring his friends to pose at length.</p>\n",
    short_description:
      "The year 1907 was a turning point for Sargent; the sought-after portraitist stepped away from his successful portraiture career to pursue plein-air landscape painting. This work, depicting his traveling companions and fellow artists Wilfrid and Jane Emmet de Glehn, captures that moment of transition. Combining landscape and portraiture, the composition speaks to friendship and painterly pursuits while also celebrating color, light, and movement.",
