    place_of_origin: "London",
    description:
      "<p><em>Mrs. George Swinton</em> epitomizes the painterly virtuosity that made John Singer Sargent one of the most fashionable portraitists in late-19th-century Europe and America. Extravagant color and brushwork were central to Sargent’s success, as was his ability to present a refined and appealing image of his sitter. In Elizabeth “Elsie” Swinton’s case, he accentuated her regal bearing and feminine dress. Sargent harmonized the realism of her face and body with bursts of impressionistic brushstrokes describing the shimmering, translucent fabric descending from her shoulder. Swinton was also known for her musical talents; at the time her portrait was executed, she was recognized as an amateur singer and later began performing professionally.</p>\n",
    short_description:
      "John Singer Sargent was one of the most fashionable portraitists in late 19th-century Europe and America. Extravagant color and brushwork were central to Sargent’s success, as was his ability to present a refined image of his sitter. Here, Sargent accentuated Mrs. George Swinton's regal bearing and feminine dress, harmonizing the realism of her face with bursts of impressionistic brushstrokes describing her gown's shimmering fabric.",
